  return (
    <>
      <Header />
      <section id="bigcake">
        <div className="bigcake-text">
          <img className="soy2" src="./images/recipe/soy_no leg2.png" alt="" />
          <h1>無麩純素熱帶水果椰奶蛋糕</h1>
        </div>
        <img className="cherry2" src="./images/recipe/cherry_no leg2.png" alt="" />
        <img className="main_pic" src="" alt="" />

      </section>
      <Footer/>
    </>
  );
}
